script: |
  super -f text -I q5141.spq | sort > q5141.out

inputs:
  - name: q5141.spq
    data: |
      SELECT + col1 FROM tab1 (FORMAT parquet) WHERE NOT + ( - + 89 ) * - col1 + - 67 + - + col2 IN ( col0 * - 47 + + 58 );
  - name: tab1

outputs:
  - name: q5141.out
    data: |
      14
      47
      5
